    <header><nav><a href="/index.html">Minh Ton</a> <a href="/services/web/index.html">Web Development</a> <a href="#about">About</a> <a href="#skills">Skills</a> <a href="/projects.html">Projects</a> <a href="#contacts">Contacts</a></nav></header><section><h1>Minh Ton - Full-stack Software Developer</h1><p>I turn problems into purpose with professional solutions in web, desktop, and game development. Freelance-ready in Ho Chi Minh City.<p>Technologies: HTML5, CSS, JavaScript, React JS/TS, Java (Spring, Servlet, JSP), ASP.NET C# (API, Razor Pages, MVC), C# Desktop (Winform, WPF, MAUL), Java Desktop (Javafx, Swing), Unity, TCP/UDP/Sockets, SignalR, SQL, SQL Server, MySQL, PostgreSQL, SQLite, VPS Deployment, Azure Cloud, Git, CI/CD, Cloudflare.<p>Stats: Over 40 projects completed, 3+ years of coding experience, 100% client satisfaction.</p><a href="/projects.html">View My Work</a> <a href="#contacts">Let's Build Together</a> <img alt="Minh Ton - Full-stack Developer"src="/imgs/avatar.webp"></section><section><h2>About Minh Ton</h2><p>I’m a developer who crafts bold solutions for web, desktop, and game development. From e-commerce systems to immersive 2D/3D games, I focus on creativity, smooth user experience, and clean code.<p>Services: Website Development (responsive, modern websites), Game Development (2D/3D games), App Development (desktop and tools), Team Collaboration.<p>Currently open to freelance or part-time opportunities.</p><a href="/projects.html">View Web Projects</a> <a href="/projects.html">View Game Projects</a> <a href="/projects.html">View Desktop App Projects</a></section><section><h2>Skills In Action</h2><p>Web: HTML5, CSS, JavaScript, React JS/TS, Java (Spring, Servlet, JSP), ASP.NET C# (API, Razor Pages, MVC).<p>Desktop: C# (Winform, WPF, MAUL), Java (Javafx, Swing).<p>Game: Unity, Java Core, Vanilla JS.<p>Networking: TCP, UDP, Sockets, SignalR.<p>DevOps & Databases: SQL, SQL Server, MySQL, PostgreSQL, SQLite, VPS Deployment, IIS, Azure Cloud, Git, CI/CD, Cloudflare (SSL, CDN, DNS).</section><section><h2>Projects</h2><p>Explore my work across web, desktop, and game development.<ul><li><img alt="Personal Blog Project"src="/imgs/personal_blog/homepage_black(1).webp"><li><img alt="Food Forum Project"src="/imgs/food_forum/recipe-detail.webp"><li><img alt="Accessories Store Project"src="/imgs/accessories_store/homepage.webp"><li><img alt="Robux Marketplace Project"src="/imgs/robux_marketplace/balance.webp"><li><img alt="Facebook Marketplace Project"src="/imgs/fb_marketplace/homepage(1).webp"><li><img alt="Labroom Management Project"src="/imgs/labroom_management/edit-schedule.webp"><li><img alt="BDO Homepage Project"src="/imgs/bdo_homepage/map(1).webp"></ul><a href="/projects.html">View All Projects</a></section><section><h2>What Clients Say</h2><ul><li><p>“Legit x1000, super fast delivery!!”<p>Tri Duc Nguyen (Facebook Review)</p><img alt="Client review for Minh Ton's web development"src="/imgs/clients/1.png"><li><p>“Very reliable and enthusiastic.”<p>Thanh Tran Minh (Facebook Review)</p><img alt="Client review for Minh Ton's services"src="/imgs/clients/2.png"><li><p>“This friend trustworthy and deliver quality work.”<p>Bui Thi Ngoc An (Facebook Review)</p><img alt="Client review for Minh Ton's projects"src="/imgs/clients/3.png"><li><p>“This guy is trustworthy and very enthusiastic.”<p>Hi Hi (Facebook Review)</p><img alt="Client review for Minh Ton's freelance work"src="/imgs/clients/4.png"><li><p>“Very reliable and enthusiastic.”<p>Pham Xuan Hieu (Facebook Review)</p><img alt="Client review for Minh Ton's development"src="/imgs/clients/5.png"></ul></section><section><h2>Connect With Me</h2><p>Contact me via social media for collaboration or inquiries.</p><a href="https://www.youtube.com/@IkuraIsCoding">YouTube</a> <a href="https://www.facebook.com/TTPNMinh/">Facebook</a> <a href="https://github.com/IkMinhTon">GitHub</a> <a href="https://www.tiktok.com/@ikuraiscoding">TikTok</a> <a href="https://zalo.me/0915682176
